INSERT INTO `tours` VALUES (1,'Los Cabos City Tour','<p>Embark on an exciting journey through the beautiful cities of Cabo San Lucas and San Jose del Cabo. Experience the vibrant culture and unique history of these Baja California gems with our Los Cabos City Tour.</p>\r\n\r\n<p style=\"text-align:center\"><strong><span style=\"font-size:26px\"><span style=\"color:#ffffff\"><span style=\"background-color:#2ecc71\">Dive into the Cabo San Lucas City Tour</span></span></span></strong></p>\r\n\r\n<p>Explore the wonders of Cabo San Lucas. We start at the world-famous Glass Factory, where you&#39;ll witness glass masters perform their magic. Next, we head to downtown Cabo San Lucas for a dose of vibrant local culture and to learn about the region&#39;s history at the Packing House.</p>\r\n\r\n<h2 style=\"text-align:center\"><strong><span style=\"font-size:26px\"><span style=\"color:#ffffff\"><span style=\"background-color:#2ecc71\">Uncover the Secrets of San Jose del Cabo City Tour</span></span></span></strong></h2>\r\n\r\n<p>Our journey continues to San Jose del Cabo. Admire the striking Misi&oacute;n de San Jos&eacute; del Cabo Anuiti, surrounded by colorful plazas and galleries. If you&#39;re joining us on a Thursday, don&#39;t miss the Art Walk, where local artists showcase their talent, and artisans sell exquisite handmade crafts.</p>\r\n\r\n<h2 style=\"text-align:center\">&nbsp;</h2>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#ffffff\"><strong><span style=\"font-size:26px\"><span style=\"background-color:#2ecc71\">Why Choose Our Los Cabos City Tour</span></span></strong></span></h2>\r\n\r\n<p>Your comfort, safety, and satisfaction are our top priorities. We offer authentic experiences and professional service, ensuring your Los Cabos City Tour is one to remember.</p>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#ffffff\"><span style=\"font-size:26px\"><strong><span style=\"background-color:#2ecc71\">Join Us for an Adventure</span></strong></span></span></h2>\r\n\r\n<p>Don&#39;t wait any longer. Join us on this fascinating journey through Cabo San Lucas and San Jose del Cabo. Book your Los Cabos City Tour today and prepare your senses for an unmatched cultural experience.</p>\r\n\r\n<p style=\"text-align:center\"><input type=\"button\" value=\"Book Your Adventure Now\" /></p>','Discover Cabo San Lucas and San Jose del Cabo with our Los Cabos City Tour. Experience art, culture, and history. Book your unforgettable journey now!',NULL,'9:00am','10:00pm',NULL,250.00,'2023-07-09 10:47:39','2023-07-09 10:57:49');
/*!40000 ALTER TABLE `tours` ENABLE KEYS */;
UNLOCK TABLES;

